interface IUniswapV2Router01 {
    function factory() external pure returns (address);
    function WETH() external pure returns (address);

    function addLiquidity(
        address tokenA,
        address tokenB,
        uint amountADesired,
        uint amountBDesired,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external returns (uint amountA, uint amountB, uint liquidity);
    function addLiquidityETH(
        address token,
        uint amountTokenDesired,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external payable returns (uint amountToken, uint amountETH, uint liquidity);
    function removeLiquidity(
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external returns (uint amountA, uint amountB);
    function removeLiquidityETH(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external returns (uint amountToken, uint amountETH);
    function removeLiquidityWithPermit(
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline,
        bool approveMax, uint8 v, bytes32 r, bytes32 s
    ) external returns (uint amountA, uint amountB);
    function removeLiquidityETHWithPermit(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline,
        bool approveMax, uint8 v, bytes32 r, bytes32 s
    ) external returns (uint amountToken, uint amountETH);
    function swapExactTokensForTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);
    function swapTokensForExactTokens(
        uint amountOut,
        uint amountInMax,
        address[] calldata path,
        address to,
        uint deadline
    ) external returns (uint[] memory amounts);
    function swapExactETHForTokens(uint amountOutMin, address[] calldata path, address to, uint deadline)
    external
    payable
    returns (uint[] memory amounts);
    function swapTokensForExactETH(uint amountOut, uint amountInMax, address[] calldata path, address to, uint deadline)
    external
    returns (uint[] memory amounts);
    function swapExactTokensForETH(uint amountIn, uint amountOutMin, address[] calldata path, address to, uint deadline)
    external
    returns (uint[] memory amounts);
    function swapETHForExactTokens(uint amountOut, address[] calldata path, address to, uint deadline)
    external
    payable
    returns (uint[] memory amounts);

    function quote(uint amountA, uint reserveA, uint reserveB) external pure returns (uint amountB);
    function getAmountOut(uint amountIn, uint reserveIn, uint reserveOut) external pure returns (uint amountOut);
    function getAmountIn(uint amountOut, uint reserveIn, uint reserveOut) external pure returns (uint amountIn);
    function getAmountsOut(uint amountIn, address[] calldata path) external view returns (uint[] memory amounts);
    function getAmountsIn(uint amountOut, address[] calldata path) external view returns (uint[] memory amounts);
}

interface IUniswapV2Router02 is IUniswapV2Router01 {
    function removeLiquidityETHSupportingFeeOnTransferTokens(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline
    ) external returns (uint amountETH);
    function removeLiquidityETHWithPermitSupportingFeeOnTransferTokens(
        address token,
        uint liquidity,
        uint amountTokenMin,
        uint amountETHMin,
        address to,
        uint deadline,
        bool approveMax, uint8 v, bytes32 r, bytes32 s
    ) external returns (uint amountETH);

    function swapExactTokensForTokensSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external;
    function swapExactETHForTokensSupportingFeeOnTransferTokens(
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external payable;
    function swapExactTokensForETHSupportingFeeOnTransferTokens(
        uint amountIn,
        uint amountOutMin,
        address[] calldata path,
        address to,
        uint deadline
    ) external;
}

interface IUniswapV2Factory {
    event PairCreated(address indexed token0, address indexed token1, address pair, uint);

    function feeTo() external view returns (address);
    function feeToSetter() external view returns (address);

    function getPair(address tokenA, address tokenB) external view returns (address pair);
    function allPairs(uint) external view returns (address pair);
    function allPairsLength() external view returns (uint);

    function createPair(address tokenA, address tokenB) external returns (address pair);

    function setFeeTo(address) external;
    function setFeeToSetter(address) external;
}

interface IXGrape {
    function mintWithBacking(uint256 numTokens, address recipient) external returns (uint256);
}

interface IVault is IERC20 {
    function deposit(uint amount) external;
}

contract LPZapper {

    // constants
    IVault public constant Underlying = IVault(0x0dA1DC567D81925cFf22Df74C6b9e294E9E1c3A5);
    IUniswapV2Router02 public constant router = IUniswapV2Router02(0xC7f372c62238f6a5b79136A9e5D16A2FD7A3f0F5);
    address public constant LP = 0x9076C15D7b2297723ecEAC17419D506AE320CbF1;
    address public constant MIM = 0x130966628846BFd36ff31a822705796e8cb8C18D;
    address public constant GRAPE = 0x5541D83EFaD1f281571B343977648B75d95cdAC2;
    address public constant XGRAPE = 0x95CED7c63eA990588F3fd01cdDe25247D04b8D98;

    receive() external payable {}

    function zapWithAvax(uint256 minOut) external payable {

        // convert token to Underlying
        _convertTokenToUnderlying(address(0));

        // require minOut
        uint256 bal = Underlying.balanceOf(address(this));
        require(
            bal >= minOut,
            'Min LP Out'
        );

        // mint xGrape
        _mintXGrape(bal);

        // pair liquidity for xGrape - Grape
        _pairLiquidity(XGRAPE, GRAPE, msg.sender);

        // refund dust
        _refundDust(msg.sender);
    }

    function zap(address token_, uint256 amount, uint256 minOut) external {

        // transfer in `amount` of `token`
        _transferIn(token_, amount);

        // convert token to Underlying
        _convertTokenToUnderlying(token_);

        // require minOut
        uint256 bal = Underlying.balanceOf(address(this));
        require(
            bal >= minOut,
            'Min LP Out'
        );

        // mint xGrape
        _mintXGrape(bal);

        // pair liquidity for xGrape - Grape
        _pairLiquidity(XGRAPE, GRAPE, msg.sender);

        // refund dust
        _refundDust(msg.sender);
    }

    function _mintXGrape(uint256 bal) internal {
        // approve Miner for balance
        Underlying.approve(XGRAPE, bal);

        // deposit for sender
        IXGrape(XGRAPE).mintWithBacking(bal, address(this));
    }

    function _convertTokenIntoTokensForLP(address token_) internal {

        if ( token_ == MIM) {

            // swap half token_ for other token
            uint256 amount = 3 * IERC20(token_).balanceOf(address(this)) / 4;

            // approve of swap
            IERC20(token_).approve(address(router), amount);

            // Swap Path
            address[] memory path = new address[](2);
            path[0] = token_;
            path[1] = GRAPE;

            // Swap The Tokens
            router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
                amount, 0, path, address(this), block.timestamp + 10
            );

            // gas savings
            delete path;

        } else if ( token_ == GRAPE ) {

            // swap half token_ for other token
            uint256 amount = IERC20(token_).balanceOf(address(this)) / 4;

            // approve of swap
            IERC20(token_).approve(address(router), amount);

            // Swap Path
            address[] memory path = new address[](2);
            path[0] = token_;
            path[1] = MIM;

            // Swap The Tokens
            router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
                amount, 0, path, address(this), block.timestamp + 10
            );

            // gas savings
            delete path;

        } else {

            // Swap Path WETH -> MIM
            address[] memory path = new address[](2);
            path[0] = router.WETH();
            path[1] = MIM;

            // swap balance into MIM, then swap MIM into Grape
            router.swapExactETHForTokens{
                value: address(this).balance / 4
            }(0, path, address(this), block.timestamp + 10);

            // swap rest of balance into GRAPE
            path[1] = GRAPE;

            // swap balance into MIM, then swap MIM into Grape
            router.swapExactETHForTokens{
                value: address(this).balance
            }(0, path, address(this), block.timestamp + 10);

            // clear memory
            delete path;
        }
    }

    function _convertTokenToUnderlying(address token_) internal {

        // convert token to LP token
        _convertTokenIntoTokensForLP(token_);

        // pair liquidity
        _pairLiquidity(MIM, GRAPE, address(this));

        // deposit liquidity token into vault
        _depositIntoVault();
    }

    function _depositIntoVault() internal {
        // stake all LP balance Into Vault
        uint256 bal = IERC20(LP).balanceOf(address(this));
        IERC20(LP).approve(address(Underlying), bal);
        Underlying.deposit(bal);
    }

    function _pairLiquidity(
        address token0,
        address token1,
        address dest
    ) internal {

        // fetch balances
        uint256 bal0 = IERC20(token0).balanceOf(address(this));
        uint256 bal1 = IERC20(token1).balanceOf(address(this));

        // approve tokens
        IERC20(token0).approve(address(router), bal0);
        IERC20(token1).approve(address(router), bal1);

        // add liquidity
        router.addLiquidity(
            token0, 
            token1, 
            bal0,
            bal1,
            0,
            0,
            dest,
            block.timestamp + 10
        );
    }

    function _refundDust(address recipient) internal {

        // refund dust
        uint bal0 = IERC20(MIM).balanceOf(address(this));
        uint bal1 = IERC20(GRAPE).balanceOf(address(this));
        uint bal2 = IERC20(XGRAPE).balanceOf(address(this));
        if (bal0 > 0) {
            IERC20(MIM).transfer(
                recipient,
                bal0
            );
        }
        if (bal1 > 0) {
            IERC20(GRAPE).transfer(
                recipient,
                bal1
            );
        }
        if (bal2 > 0) {
            IERC20(XGRAPE).transfer(
                recipient,
                bal2
            );
        }
    }

    function _transferIn(address token, uint256 amount) internal {
        require(
            IERC20(token).transferFrom(
                msg.sender,
                address(this),
                amount
            ),
            'Failure Transfer From'
        );
    }
}

